import React from "react";
import '../assets/css/Raw.css';


const Raw = () => {
    let join = "Join Space ";
    return (
        <div class="row-cols-1 row justify-content-center">
            <div class="col-6">
                <h2 className="join">{join}
                    <span className="name_tribe">Holberton ðŸ“š ðŸ¦ˆ</span>
                </h2>
            <p className="paragraph_signup">No signup or downloads needed</p>
            </div>
            <div class="col-6">
                <form>
                    <div class="row">
                        <div class="col">
                        <label for="formGroupExampleInput">Your Name</label>
                            <input type="text" class="form-control" placeholder="Enter Your Name" />
                        </div>
                    </div>
                </form>
            </div>
            <div class="col-6">
                <section className="paragraph_permision">
                    <p className="text_permision">Tribe needs your permission to access the camera and microphone.</p>
                    <button type="button" class="btn btn-primary">Grant permission</button>
                </section>
            </div>
            <div class="col-6">
            <button type="button" class="btn btn-primary btn-lg btn-block">Join</button>
            </div>
        </div>
    );
};

export default Raw;
